import React from 'react';
import './StaffEntry.css';


class StaffEntry extends React.Component {
	constructor(props) {
		const pic = require(this.props.entry.path);
	}

    render() {
    	console.log(this.props.entry.path)
        return(
          <div className="entry">
              <div className="row" style={{height:"100vh"}}>
              		<div className="flex-column-35 col-home-left">
              			<img alt={this.props.entry.name} src={pic}/>
              		</div>
              		<div className="flex-column-65 col-home-right">
              			<div className="staff-name">{this.props.entry.name}</div>
              			{this.props.entry.description}
              		</div>
              </div>
          </div>
        )
    }
}

export default StaffEntry;
